import { useState } from "react";
import "./App.css";

function App() {
  const [opcion1, setOpcion1] = useState("");
  const [opcion2, setOpcion2] = useState("");
  return (
    <div className="App">
      <select >
        <option value="bebx">Bebx</option>
        <option value="pensa">Pensa</option>
        <option value="risa">Risa</option>
        <option value="quemado">Quemado</option>
        <option value="enojada"> Enojada</option>
      </select>
      <br />
      <input
        type="text"
        placeholder="Opcion 1"
        onChange={(e) => setOpcion1(e.target.value)}
      />
      <br />
      <input
        type="text"
        placeholder="Opcion 2"
        onChange={(e) => setOpcion2(e.target.value)}
      />
      <br />
      <button>Exportar</button>

      <div>
        <span>{opcion1}</span>
        <br />
        <br />
        <span>{opcion2}</span>
        <img src="" />
      </div>
    </div>
  );
}

export default App;
